import './App.css';

import SideNav from '../SideNav/SideNav'
import MainContent from '../MainContent/MainContent'

function App() {
  return (
    <div className='App'>
      <SideNav />
      <Router>
        <Routes>
          <Route exact path='/' element={<MainContent />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
